  ?person dbo:birthName "John Devon Roland Pertwee" ;
           dbo:child ?child .
  ?child dbo:occupation dbo:Actor , dbo:Narrator , dbo:Producer ;
          dbo:claimToFame ?film , ?militaryConflict .
  FILTER(?film IN (SELECT ?film WHERE { ?film a dbo:Film. }))
  FILTER(?militaryConflict IN (SELECT ?conflict WHERE { ?conflict a dbo:MilitaryConflict. }))
}
LIMIT 1

